import { createRouter, createWebHistory } from 'vue-router';
import store from '../store';

const routes = [
  {
    path: '/',
    redirect: '/login'
  },
  {
    path: '/login',
    name: 'Login',
    component: () => import('../views/Login.vue'),
    meta: { requiresAuth: false }
  },
  {
    path: '/register',
    name: 'Register',
    component: () => import('../views/Register.vue'),
    meta: { requiresAuth: false }
  },
  {
    path: '/profile',
    name: 'Profile',
    component: () => import('../views/Profile.vue'),
    meta: { requiresAuth: true }
  },
  {
    path: '/test-input',
    name: 'TestInput',
    component: () => import('../views/TestInput.vue'),
    meta: { requiresAuth: false }
  },
  // æ•™å¸ˆç«¯è·¯ç”±
  {
    path: '/teacher',
    name: 'TeacherDashboard',
    component: () => import('../views/teacher/Dashboard.vue'),
    meta: { requiresAuth: true, role: 'teacher' }
  },
  {
    path: '/teacher/upload',
    name: 'TeacherUpload',
    component: () => import('../views/teacher/PhotoUpload.vue'),
    meta: { requiresAuth: true, role: 'teacher' }
  },
  {
    path: '/teacher/class',
    name: 'TeacherClass',
    component: () => import('../views/teacher/ClassManagement.vue'),
    meta: { requiresAuth: true, role: 'teacher' }
  },
  {
    path: '/teacher/users',
    name: 'TeacherUsers',
    component: () => import('../views/teacher/UserManagement.vue'),
    meta: { requiresAuth: true, role: 'teacher' }
  },
  // å®¶é•¿ç«¯è·¯ç”±
  {
    path: '/parent',
    name: 'ParentDashboard',
    component: () => import('../views/parent/Dashboard.vue'),
    meta: { requiresAuth: true, role: 'parent' }
  },
  {
    path: '/parent/photos',
    name: 'ParentPhotos',
    component: () => import('../views/parent/PrivatePhotos.vue'),
    meta: { requiresAuth: true, role: 'parent' }
  },
  {
    path: '/parent/public',
    name: 'ParentPublic',
    component: () => import('../views/parent/PublicPhotos.vue'),
    meta: { requiresAuth: true, role: 'parent' }
  },
  // 404é¡µé¢
  {
    path: '/:pathMatch(.*)*',
    name: 'NotFound',
    component: () => import('../views/NotFound.vue')
  }
];

const router = createRouter({
  history: createWebHistory(),
  routes
});

// è·¯ç”±å®ˆå«
router.beforeEach((to, from, next) => {
  const isAuthenticated = store.getters.isAuthenticated;
  const userRole = store.getters.userInfo?.role;

  // æ£€æŸ¥æ˜¯å¦éœ€è¦è®¤è¯
  if (to.meta.requiresAuth && !isAuthenticated) {
    next('/login');
    return;
  }

  // æ£€æŸ¥è§’è‰²æƒé™
  if (to.meta.role && userRole !== to.meta.role) {
    // æ ¹æ®è§’è‰²é‡å®šå‘åˆ°å¯¹åº”çš„é¦–é¡µ
    if (userRole === 'teacher') {
      next('/teacher');
    } else if (userRole === 'parent') {
      next('/parent');
    } else {
      next('/login');
    }
    return;
  }

  // å·²ç™»å½•ç”¨æˆ·è®¿é—®ç™»å½•é¡µé¢ï¼Œé‡å®šå‘åˆ°å¯¹åº”é¦–é¡µ
  if (isAuthenticated && to.path === '/login') {
    if (userRole === 'teacher') {
      next('/teacher');
    } else if (userRole === 'parent') {
      next('/parent');
    } else {
      next('/');
    }
    return;
  }

  next();
});

export default router;

import { createStore } from 'vuex';
import axios from 'axios';

const API_BASE_URL = process.env.VUE_APP_API_URL || 'http://localhost:3000/api';

// é…ç½®axios
axios.defaults.baseURL = API_BASE_URL;
axios.defaults.withCredentials = true;

// åˆ›å»ºstore
const store = createStore({
  state: {
    token: localStorage.getItem('token') || null,
    user: JSON.parse(localStorage.getItem('user') || 'null'),
    loading: false,
    error: null,
    classes: [],
    photos: [],
    users: []
  },
  mutations: {
    SET_TOKEN(state, token) {
      state.token = token;
      if (token) {
        localStorage.setItem('token', token);
        axios.defaults.headers.common['Authorization'] = `Bearer ${token}`;
      } else {
        localStorage.removeItem('token');
        delete axios.defaults.headers.common['Authorization'];
      }
    },
    
    SET_USER(state, user) {
      state.user = user;
      if (user) {
        localStorage.setItem('user', JSON.stringify(user));
      } else {
        localStorage.removeItem('user');
      }
    },
    
    SET_LOADING(state, loading) {
      state.loading = loading;
    },
    
    SET_ERROR(state, error) {
      state.error = error;
    },
    
    SET_CLASSES(state, classes) {
      state.classes = classes;
    },
    
    SET_PHOTOS(state, photos) {
      state.photos = photos;
    },
    
    SET_USERS(state, users) {
      state.users = users;
    }
  },
  
  actions: {
    async login({ commit }, credentials) {
      try {
        commit('SET_LOADING', true);
        commit('SET_ERROR', null);
        
        const response = await axios.post('/auth/login', credentials);
        const { token, user } = response.data;
        
        commit('SET_TOKEN', token);
        commit('SET_USER', user);
        
        return response.data;
      } catch (error) {
        const message = error.response?.data?.error || 'ç™»å½•å¤±è´¥';
        commit('SET_ERROR', message);
        throw new Error(message);
      } finally {
        commit('SET_LOADING', false);
      }
    },
    
    async register({ commit }, userData) {
      try {
        commit('SET_LOADING', true);
        commit('SET_ERROR', null);
        
        const response = await axios.post('/auth/register', userData);
        return response.data;
      } catch (error) {
        const message = error.response?.data?.error || 'æ³¨å†Œå¤±è´¥';
        commit('SET_ERROR', message);
        throw new Error(message);
      } finally {
        commit('SET_LOADING', false);
      }
    },
    
    logout({ commit }) {
      commit('SET_TOKEN', null);
      commit('SET_USER', null);
      commit('SET_CLASSES', []);
      commit('SET_PHOTOS', []);
      commit('SET_USERS', []);
    },
    
    async fetchUserProfile({ commit }) {
      try {
        const response = await axios.get('/users/profile');
        commit('SET_USER', response.data);
        return response.data;
      } catch (error) {
        throw new Error(error.response?.data?.error || 'è·å–ç”¨æˆ·ä¿¡æ¯å¤±è´¥');
      }
    },
    
    async fetchClasses({ commit }) {
      try {
        const response = await axios.get('/classes');
        commit('SET_CLASSES', response.data);
        return response.data;
      } catch (error) {
        throw new Error(error.response?.data?.error || 'è·å–ç­çº§åˆ—è¡¨å¤±è´¥');
      }
    },
    
    async fetchPublicPhotos({ commit }, params = {}) {
      try {
        const response = await axios.get('/photos/public', { params });
        commit('SET_PHOTOS', response.data.photos);
        return response.data;
      } catch (error) {
        throw new Error(error.response?.data?.error || 'è·å–ç…§ç‰‡å¤±è´¥');
      }
    },
    
    async fetchPrivatePhotos({ commit }, params = {}) {
      try {
        const response = await axios.get('/photos/private', { params });
        commit('SET_PHOTOS', response.data.photos);
        return response.data;
      } catch (error) {
        throw new Error(error.response?.data?.error || 'è·å–ç…§ç‰‡å¤±è´¥');
      }
    },
    
    async uploadPhotos({ commit }, formData) {
      try {
        commit('SET_LOADING', true);
        const response = await axios.post('/photos', formData, {
          headers: {
            'Content-Type': 'multipart/form-data'
          }
        });
        return response.data;
      } catch (error) {
        throw new Error(error.response?.data?.error || 'ä¸Šä¼ ç…§ç‰‡å¤±è´¥');
      } finally {
        commit('SET_LOADING', false);
      }
    },
    
    async likePhoto(_, photoId) {
      try {
        const response = await axios.post('/photos/like', { photoId });
        return response.data;
      } catch (error) {
        throw new Error(error.response?.data?.error || 'ç‚¹èµå¤±è´¥');
      }
    },
    
    async searchPhotos({ commit }, query) {
      try {
        const response = await axios.get('/photos/search', { params: { query } });
        commit('SET_PHOTOS', response.data.photos);
        return response.data;
      } catch (error) {
        throw new Error(error.response?.data?.error || 'æœç´¢å¤±è´¥');
      }
    },
    
    async fetchUsers({ commit }, params = {}) {
      try {
        const response = await axios.get('/users', { params });
        commit('SET_USERS', response.data);
        return response.data;
      } catch (error) {
        throw new Error(error.response?.data?.error || 'è·å–ç”¨æˆ·åˆ—è¡¨å¤±è´¥');
      }
    }
  },
  
  getters: {
    isAuthenticated: (state) => !!state.token,
    userInfo: (state) => state.user,
    isTeacher: (state) => state.user?.role === 'teacher',
    isParent: (state) => state.user?.role === 'parent',
    isLoading: (state) => state.loading,
    error: (state) => state.error,
    classes: (state) => state.classes,
    photos: (state) => state.photos,
    users: (state) => state.users
  }
});

// å¦‚æœæœ‰tokenï¼Œåˆå§‹åŒ–æ—¶è®¾ç½®
if (store.state.token) {
  axios.defaults.headers.common['Authorization'] = `Bearer ${store.state.token}`;
}

export default store;
